import { Component } from "react";

const ListOfEmojis = [
    { text :"Smiling",Symbol:'üòä'},
    { text:"disbelief",Symbol:'üò≥'},
    { text:"sad",Symbol:'üòî'},
    { text:"takeout box",Symbol:'ü•°'},
    { text:"love",Symbol:'‚ù§Ô∏è'},
    { text:"annoyance",Symbol:'üòë'},
    { text:"face",Symbol:'üòÄ'},
    { text:"face",Symbol:'üòÅ'},
    { text:"face",Symbol:'üòÇ'},
    { text:"face",Symbol:'üò¨'},
    { text:"face",Symbol:'üòÖ'},
    { text:"face",Symbol:'üòÜ'},
    { text:"face",Symbol:'üòá'},
    { text:"face",Symbol:'üòâ'},
    { text:"face",Symbol:'üôÇ'},
    { text:"face",Symbol:'üôÉ'},
    {text:"face",Symbol:'üòã'},
    {text:"face",Symbol:'üòå'},
    {text:"face",Symbol:'üòç'},
    { text:"face",Symbol:'üòÜ'},
    { text:"face",Symbol:'üòá'},
    { text:"face",Symbol:'üòâ'},
    { text:"face",Symbol:'üôÇ'},
    { text:"face",Symbol:'üôÉ'},
    {text:"face",Symbol:'üòã'},
    {text:"face",Symbol:'üòå'},
    {text:"face",Symbol:'üòç'},
]

class AllSymbols extends Component{
    render(){
        return(
            <div>
                   
                   <table> 
                       <tr>
                        {
                        ListOfEmojis.map((item,index)=>{
                           return(
                               <td>
                              <div id={item.text} className={item.text}> 
                                   {item.Symbol}
                                   {item.text}
                              </div>
                              </td>
                           )
                          
                        })
                    }

                     </tr>
                    </table>


          
            </div>
        )
    }
}

export default AllSymbols;
